import ExpenseItem from './components/ExpenseItem';

function App() {
  const Expenses = [
    {name:"Keeway C200 MotorCycle", Date:"20 aug 2024",price:1000},
    {name:"macbook pro", Date:"20 aug 2022",price:500},
    {name:"Peugeut 406", Date:"20 aug 2052",price:2000},
  ]
  return (
    <div className="bg-slate-800 w-screen h-screen m-0 absolute px-4">
      {Expenses.forEach(expense => 
        <ExpenseItem title={expense.name}></ExpenseItem>)}

    </div>
  );
}

export default App;
